import React from 'react';
import './Form.css';

const FormSuccess = () => {
  return (
    <div className='form-content-right'>
      <h1 className='form-success'>¡Tu cuenta ha sido creada éxitosamente!</h1>
      <img className='form-img-2' src="../images/people.jpg" alt='success-image' />
    </div>
  );
};

export default FormSuccess;
